// FunciÃ³n central para manejar todos los sets
async function armaduras(message) {
    const lowercase = message.body.toLowerCase();

    for (const key in ARMADURAS) {
        const set = ARMADURAS[key];
        if (lowercase === set.comando) {
            try {
                const media = MessageMedia.fromFilePath(set.imagen);
                await sony.sendMessage(message.from, media, { caption: `*${set.titulo}*\n\n${set.caption}` });
                logger.success(`âœ… Enviado set ${key} a ${message.from}`);
            } catch (error) {
                logger.error(`âš ï¸ Error al enviar el set ${key} a ${message.from}:`, error);
            }
            break; // Salimos despuÃ©s de enviar
        }
    }
}

